import React, { Component } from 'react';
import logo from './media-encoder.png';
import './App.css';
import { FaFolderPlus } from 'react-icons/fa';


const icon = {
  fontSize: '80pt',
  marginTop:'40px'
};

const title = {
  padding:40,
  fontSize:16,
};


class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className='App-logo' alt='logo'/>
          <p style={title}>Encoder vos vid√©os</p>
        </header>

      <ul class="flex-container">
        <li class="flex-item"><p>BPUBLI</p><div class="Icon"><FaFolderPlus style={icon}/></div></li>
        <li class="flex-item"><p>SVAP</p><div class="Icon"><FaFolderPlus style={icon}/></div></li>
      </ul>
      </div>
    );
  }
}

export default App;
